import React from "react";
import { motion } from "framer-motion";
import {
  SearchContainer,
  SearchButtonContainer,
  SearchInputContainer,
  Icon,
} from "./Search.style";

const Search = () => {
  return (
    <SearchContainer>
      <SearchInputContainer
        type="text"
        name=""
        placeHolder="Search"
        initial={{ width: "0" }}
        whileHover={{ width: "15em" }}
      />
      <SearchButtonContainer whileHover={{ scale: 0.8 }}>
        <Icon width="47" height="48" viewBox="0 0 47 48">
          <circle cx="29.5" cy="17.5" r="15" stroke="black" strokeWidth="5" />
          <line
            x1="19.7678"
            y1="27.7678"
            x2="1.76777"
            y2="45.7678"
            stroke="black"
            strokeWidth="5"
          />
        </Icon>
      </SearchButtonContainer>
    </SearchContainer>
  );
};
export default Search;
